import React from "react";
import Icons from "../assets/Icons";
import GoggleKepp from "../assets/images/logo-google-keep.png";

const Dashboard = () => {
  return (
    <div className="nav-bar dp-f border-2px">
      <div className="keep-icon dp-f border-2px">

        <div className="list-3">
        <Icons name="List" size="30"/>

        </div>
        <div className="name-page">
        <a href="">
        <img class="gb_uc gb_8d" src="https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png" srcset="https://www.gstatic.com/images/branding/product/1x/keep_2020q4_48dp.png 1x, https://www.gstatic.com/images/branding/product/2x/keep_2020q4_48dp.png 2x " alt="" aria-hidden="true" style={{width:'40px',height:'40px'}}></img>
        <span class="gb_7d gb_Xc">Keep</span>
        </a>
</div>
      </div>

      <div className="search-div border-2px">hey</div>
      <div className="icons-end border-2px">work</div>
    </div>
  );
};
export default Dashboard;
